import './App.css';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Card from './components/Card';


function App() {
  return (
    <div>
      <style>
        @import url('https://fonts.googleapis.com/css2?family=Roboto:wght@300&display=swap');
      </style>
      <Navbar />
      <Hero />
      <Card />
    </div>

  );
}

export default App;
